<div style="position: fixed; top: 10px; left: 10px; width: 250px; z-index: 9999;
             background-color: white; padding: 10px; border:2px solid grey; border-radius: 5px;">
    <h4 style="margin:5px 0;">Client Map Filters</h4>
    <input type="text" id="searchBox" placeholder="Search Client or Country" style="width: 100%; margin-bottom: 10px;"/>
    <label for="countrySelect">Filter by Country:</label>
    <select id="countrySelect" style="width: 100%; margin-bottom: 10px;">
        <option value="">-- All Countries --</option>
    </select>
    <label for="turnoverRange">Turnover Filter (€):</label>
    <input type="range" id="turnoverRange" min="0" max="100000" value="0" step="1000" style="width: 100%;"/>
    <div id="turnoverValue">0</div>
    <button onclick="resetFilters()" style="margin-top:10px;">Reset Filters</button>
</div>

<script>
    const markers = figure_25c55895d20ecc41a8dd386c3ac3f4d3._layers;
    const countrySet = new Set();

    for (const key in markers) {
        const layer = markers[key];
        if (layer instanceof L.Marker && layer.getPopup()) {
            const content = layer.getPopup().getContent();
            const match = content.match(/Country: (.+?)<br>/);
            if (match) countrySet.add(match[1]);
        }
    }

    const select = document.getElementById("countrySelect");
    Array.from(countrySet).sort().forEach(c => {
        const option = document.createElement("option");
        option.value = c;
        option.text = c;
        select.appendChild(option);
    });

    document.getElementById("searchBox").addEventListener("input", function() {
        const query = this.value.toLowerCase();
        for (const key in markers) {
            const layer = markers[key];
            if (layer instanceof L.Marker && layer.getPopup()) {
                const content = layer.getPopup().getContent().toLowerCase();
                if (query && !content.includes(query)) {
                    layer.remove();
                } else {
                    layer.addTo(figure_25c55895d20ecc41a8dd386c3ac3f4d3);
                }
            }
        }
    });

    document.getElementById("countrySelect").addEventListener("change", function() {
        const selected = this.value;
        for (const key in markers) {
            const layer = markers[key];
            if (layer instanceof L.Marker && layer.getPopup()) {
                const content = layer.getPopup().getContent();
                const match = content.match(/Country: (.+?)<br>/);
                if (match && (selected === "" || match[1] === selected)) {
                    layer.addTo(figure_25c55895d20ecc41a8dd386c3ac3f4d3);
                } else {
                    layer.remove();
                }
            }
        }
    });

    document.getElementById("turnoverRange").addEventListener("input", function() {
        const value = parseFloat(this.value);
        document.getElementById("turnoverValue").innerText = value;
        for (const key in markers) {
            const layer = markers[key];
            if (layer instanceof L.Marker && layer.getPopup()) {
                const content = layer.getPopup().getContent();
                const match = content.match(/Turnover 2025: €([\d,\.]+)/);
                const turnover = match ? parseFloat(match[1].replace(/,/g, '')) : 0;
                if (turnover >= value) {
                    layer.addTo(figure_25c55895d20ecc41a8dd386c3ac3f4d3);
                } else {
                    layer.remove();
                }
            }
        }
    });

    function resetFilters() {
        document.getElementById("searchBox").value = "";
        document.getElementById("countrySelect").value = "";
        document.getElementById("turnoverRange").value = 0;
        document.getElementById("turnoverValue").innerText = 0;
        for (const key in markers) {
            const layer = markers[key];
            if (layer instanceof L.Marker) {
                layer.addTo(figure_25c55895d20ecc41a8dd386c3ac3f4d3);
            }
        }
    }
</script>
